sources.styles/components/_modal.scss:
body {
  &.modal-showing {
    overflow: hidden;
  }
}

.modal {
  position: fixed;
  height: 100vh;
  width: 100%;
  top: 0; left: 0;
  z-index: 9999;
  overflow: auto;
  background: rgba(black, 0.8);
  display: none;
  visibility: hidden;
}

.modal__liner {
  position: relative;
  height: 100vh;
  width: 100%;
  overflow: auto;
}

.modal__element {
  will-change: contents;
  width: 95%;
  background: white;
  max-width: 1200px;
  position: absolute;
  top: 50%; left: 50%;
  border-radius: 10px;
  transform: translate(-50%, -30%);
  opacity: 0;
  transition: all 400ms $ease-out-circ;
}

.modal__inner {
  padding: 1em 1em;

  display: flex;
  flex-direction: column;

  & > div { 
    width: 100%;
  }
}

.modal__product-info {
  padding: 2em 1em 1em 1em;
  overflow: auto;

  h4 {
    margin-bottom: 0.5em;
    font-size: 1.2em;
    color: $primary;
  }

  h1 {
    font-size: 2em;
  }

  p {
    font-size: 0.85em;
  }
}

.modal__add-btn {
  padding: 2em 2em 0em 2em;
}



.modal-showing {
  .modal {
    visibility: visible;
    display: block;
  }

}

.modal-element-inview {
  .modal__element {
    opacity: 1;
    transform: translate(-50%, -50%);
  }
}

.modal__add-btn {
  display: flex;
  align-items: center;
  border-top: 1px solid #eee;
  margin-top: 2em;
  padding-bottom: 2em;
  justify-content: flex-end;

  form {
    margin-left: 2em;
  }

  .add-to-cart, form {
    margin-bottom: 0;
  }
  .close-modal {
    @include btn-reset();
    font-weight: 800;
    color: #a1a1a1;
    cursor: pointer;
    font-size: 1em;
  }

  .add-to-cart {
    background: $primary;
    color: white;
    padding: 0.8em 1.5em;

    span:first-of-type {
      background: white;
      svg {
        stroke: $primary;
      }
    }
  }
}


@media(min-width: $bp-md) {  
  .modal__inner {
    justify-content: space-between;
    flex-direction: row;

    & > div { 
      width: 49%;
    }
  }

  .modal__product-info {
    max-height: 380px;
  }
  .modal__product-info {
    padding: 2em 2em 1em 2em;
  }
}

sources.styles/components/_top-nav.scss:
header {
  // opacity: 0;
  // transform: translateY(-30px);
  // z-index: 99;
  z-index: 73;
}

.hero-loaded {
  header {
    opacity: 1;
    transform: translateY(0px);
    transition: transform 800ms, opacity 800ms ease;
  }
}

.top-nav {
  background: white;
  position: relative;
  z-index: 99;
  border-bottom: 1px solid #f5f5f5;

  .inner {
    display: flex;
    align-items: center;
    // justify-content: space-between;
    justify-content: center;
    // padding: 0.5em 0em;
    padding: 1em 0em;
  }
}

.top-nav__el {
  display: flex;

  &:first-of-type {
    display: none;
  }
}

.top-nav__actionable {
  margin-right: 1.5em;
  font-size: 0.8em;

  &:last-of-type {
    margin-right: 0;
  }

  &.has-icon {
    font-weight: 700;
    margin-right: 3em;

    &:last-of-type {
      margin-right: 0;
    }
  }

  a, button {
    @include btn-reset();
    font-size: 0.9em;
    display: flex;
    align-items: center;
    text-decoration: none;
    color: black;
    font-weight: 700;

    &:hover {
      color: $primary !important;
    }

    svg {
      width: 24px;
      height: 24px;
      position: relative;
    }

    span:nth-child(2) {
      margin-left: 1em;
    }
  }
}

.cart a {
  &:hover {
    svg {
      animation: bounce 300ms alternate-reverse infinite;
    }
  }
}


@keyframes bounce {
  from {
    transform: translateY(0px);
  }
  to {
    transform: translateY(-3px);
  }
}


@media(min-width: $bp-md) {
  .top-nav {

    .inner {
      justify-content: space-between;
      padding: 0.5em 0em;
    }
  }

  .top-nav__el {

    &:first-of-type {
      display: flex;
    }
  }
}

